import React, { Component } from 'react';

class TopBar extends Component {
    render() {
        return (
            <nav class="navbar bg-body-tertiary">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">Hoaxify</a>
                </div>
            </nav>
        );
    }
}

export default TopBar;
